import React from 'react'
import styled from 'styled-components'

const TitleContainer = styled.div`
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100vw;
  color: ${({ theme }) => theme.colors.white};
`

const Title = styled.h1`
  font-size: 50px;
`
export default () => (
  <Title>
    <h1>Soon</h1>
  </Title>
)
